import React from "react";
import {
  Box,
  Container,
  Typography,
  Button,
  TextField,
  Grid,
  CssBaseline,
} from "@mui/material";

const Signup = () => {
  return (
    <Container>
      <Box display="flex" justifyContent="center">
        <Grid>
          <Typography variant="h2" style={{ margin: "10px" }}>
            Sign Up
          </Typography>
        </Grid>
      </Box>
    </Container>
  );
};

export default Signup;
